import React from 'react';
import Navbar from '../components/Navbar';
import { Link } from 'react-router-dom';

function BookInfo() {
  return (
    <div>
			<Navbar />
			<h1 className="text-3xl font-bold mb-4">BookInfo Page</h1>
			<Link to="/BookInfo">
				<button>Go to book info</button>
			</Link>

      
    </div>
  );
}

export default BookInfo;
